import "./error.css";

export const Error = () => {
  return (
    <div className="error">
      <br />
      <h3>404: Page Not Found </h3>
      <h1> OOPS! </h1>
      <h1> Looks like this page went on a vacation! </h1>
    </div>
  );
};
